import React from "react";
import { NavLink } from "react-router-dom";

export default function Navbar() {
  return (
    <div className="navbar">
      <NavLink
        exact='true'
        to="/"
        className='filmix'
      >
        FILMIX
      </NavLink>

    </div>
  );
}
